package main
import (
  "bytes"
  "encoding/base64"
  "github.com/computeportal/glui"
)
const (
  rabbit_data =""
)
var rabbit = &glui.ImageData{nil, 0, 0}
func load_rabbit() bool {
  b, err := base64.StdEncoding.DecodeString(rabbit_data)
  if err != nil {panic(err)}
  buf := bytes.NewBuffer(b)
  data, err := glui.DecodeJPG(buf)
  if err != nil {panic(err)}
  rabbit.Pix = data.Pix
  rabbit.W = data.W
  rabbit.H = data.H
  return true
}
var rabbit_loaded = load_rabbit()